import React from 'react';

const Weather = (props) => {
    return (
        <div>
                {props.city ? 
                    <div>
                        <p>City: {props.city}, {props.country}</p>
                        <p>Temperature: {props.temp}</p>
                        <p>Sunrise: {props.sunrise}</p>
                    </div> : 'mops'
                }
                <p>{props.error}</p>
            </div>
    )
}

export default Weather;
